{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/detect-credit-card-fraud-using-r?scriptVersionId=176814078\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"attachments":{"9641b186-5dd9-43e0-bc87-f3a136ca629c.png":{"image/png":""}},"cell_type":"markdown","id":"1b00ea4e","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.010234,"end_time":"2024-05-10T09:45:28.578366","exception":false,"start_time":"2024-05-10T09:45:28.568132","status":"completed"},"tags":[]},"source":["# Introduction\n","###  The purpose of this project:\n","- Every year, fraudulent transactions with credit cards result in billions of dollars in losses. The key to minimizing these losses is the development of effective fraud detection algorithms, and increasingly, these algorithms depend on cutting-edge machine learning methods to help fraud investigators. Nevertheless, because of the non-stationary distributions of the data, the extremely unbalanced classification distributions, and the ongoing streams of transactions, designing fraud detection algorithms is especially difficult. Due to confidentiality concerns, publicly available information are also hard to come by, leaving many questions regarding how to approach this problem in the dark.\n","\n","###  Some facts you need to know about Credit Card Fraud:\n","- A total of 127 million adults in America—or nearly half of the population—have experienced a fraudulent transaction on one of their credit or debit cards. Card fraud has happened more than once to more than one in three people who use credit or debit cards.\n","\n","- On American credit and debit cards, the typical charge was $62, which translates to around 8 billion in attempted fraudulent transactions. Only around 40% of cardholders have email or text notifications from their bank or credit card issuer activated.\n","\n","- Only 19% of victims with alerts turned on had to take further action to reverse fraudulent charges, compared to about 81 percent of victims without these warnings.\n","\n","### How to Detect Credit Card Fraud:\n","- Use an Address Verification System (AVS) to verify a cardholder's identity\n","- Verify the IP address of a customer\n","- Be wary of anonymous email addresses\n","- Ship only to the cardholder's billing address\n","- Analyze transaction data\n","\n","\n","\n","\n","#### The aim of this R project is to build a classifier that can detect credit card fraudulent transactions. We will use a variety of machine learning algorithms that will be able to discern fraudulent from non-fraudulent ones. By the end of this machine learning project, you will learn how to implement machine learning algorithms to perform classification.\n","\n","![image.png](attachment:9641b186-5dd9-43e0-bc87-f3a136ca629c.png)"]},{"cell_type":"markdown","id":"422da73a","metadata":{"papermill":{"duration":0.008229,"end_time":"2024-05-10T09:45:28.595087","exception":false,"start_time":"2024-05-10T09:45:28.586858","status":"completed"},"tags":[]},"source":["# Importing Libraries"]},{"cell_type":"code","execution_count":1,"id":"7b58d5e5","metadata":{"execution":{"iopub.execute_input":"2024-05-10T09:45:28.615851Z","iopub.status.busy":"2024-05-10T09:45:28.613727Z","iopub.status.idle":"2024-05-10T09:45:31.291593Z","shell.execute_reply":"2024-05-10T09:45:31.289935Z"},"papermill":{"duration":2.69039,"end_time":"2024-05-10T09:45:31.293846","exception":false,"start_time":"2024-05-10T09:45:28.603456","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loading required package: ggplot2\n","\n","Loading required package: lattice\n","\n","\n","Attaching package: ‘caret’\n","\n","\n","The following object is masked from ‘package:httr’:\n","\n","    progress\n","\n","\n"]}],"source":["library(ranger)  # A fast implementation of Random Forests, particularly suited for high dimensional data. Ensembles of classification, regression, survival and probability prediction trees are supported. \n","library(caret)  # The caret package (short for Classification And REgression Training) contains functions to streamline the model training process for complex regression\n","library(data.table)  # Fast aggregation of large data (e.g. 100GB in RAM), fast ordered joins, fast add/modify/delete of columns by group using no copies at all, list columns, friendly and fast character-separated-value read/write."]},{"cell_type":"markdown","id":"c1da0760","metadata":{"papermill":{"duration":0.008695,"end_time":"2024-05-10T09:45:31.311612","exception":false,"start_time":"2024-05-10T09:45:31.302917","status":"completed"},"tags":[]},"source":["# Importing Datasets"]},{"cell_type":"code","execution_count":2,"id":"c80b7014","metadata":{"execution":{"iopub.execute_input":"2024-05-10T09:45:31.360386Z","iopub.status.busy":"2024-05-10T09:45:31.330332Z","iopub.status.idle":"2024-05-10T09:46:07.982953Z","shell.execute_reply":"2024-05-10T09:46:07.981081Z"},"papermill":{"duration":36.664889,"end_time":"2024-05-10T09:46:07.985276","exception":false,"start_time":"2024-05-10T09:45:31.320387","status":"completed"},"tags":[]},"outputs":[],"source":["creditcard_data <- read.csv(\"/kaggle/input/creditcardfraud/creditcard.csv\")"]},{"cell_type":"markdown","id":"4732b375","metadata":{"papermill":{"duration":0.00913,"end_time":"2024-05-10T09:46:08.003445","exception":false,"start_time":"2024-05-10T09:46:07.994315","status":"completed"},"tags":[]},"source":["# Data Exploration\n","- we will explore the data that is contained in the creditcard_data dataframe. We will proceed by displaying the creditcard_data using the head() function as well as the tail() function. We will then proceed to explore the other components of this dataframe"]},{"cell_type":"code","execution_count":3,"id":"53bb3e02","metadata":{"execution":{